import React from 'react';
import './App.css';
import PreNavbar from './components/PreNavbar';
import Navbar from './components/Navbar';
import { BrowserRouter as Router,Route } from 'react-router-dom';


const App = () => {
  return (
    <Router>
      <Route path='/' element={Navbar}>
        <Navbar />
      </Route>
    </Router>

// {/* <PreNavbar /> */}
  );
}

export default App;
